import React from "react";
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import styled from "styled-components";

const WarmingUpPage = () => {
  const navigate = useNavigate();
  return (
    <Wrap>
    <HowBox>

    </HowBox>
     
      <Link to="step1">
        <Btn>빼빼로 만들고 키링 뽑으러 ㄱㄱ</Btn>
      </Link>


    </Wrap>
  );
};

const Wrap = styled.div`
  width: 60%;
  height: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
`;

const HowBox = styled.div`
    width: 600px;
    height: 400px;
    position: fixed;
    top:40%;
    background-color: red;
`;

const Btn = styled.button`
  width: 350px;
  height: 350px;
  border-radius: 50%;
  border: 2px solid orange;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 2rem;
  &:first-child {
    margin-right: 5%;
  }
`;

export default WarmingUpPage;
